const useGetOrders=()=> {

const fetchData = async () => {
  try {
    const url = 'http://localhost:3000/orders';
    const response = await fetch(url);
    const data = await response.json();
    console.log(data)
  } catch (error){
    console.log(error)
  }
}

useEffect(()=>{    
  fetchData()
})


